import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { Sparkles, Loader, Settings, X } from 'lucide-react';

const AIExplainer = ({ classificationReport, modelName }) => {
  const [explanation, setExplanation] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const [showExplanation, setShowExplanation] = useState(false);
  const [showSettings, setShowSettings] = useState(false);
  const [apiKey, setApiKey] = useState(localStorage.getItem('gemini_api_key') || '');
  const [prompt, setPrompt] = useState(
    localStorage.getItem('gemini_prompt') || 
    'Explain this classification report in simple terms. Focus on what precision, recall, and f1-score mean for this model performance:'
  );

  const handleExplain = async () => {
    if (!apiKey) {
      alert('Please set your Gemini API key in settings');
      setShowSettings(true);
      return;
    }

    setIsLoading(true);
    setShowExplanation(true);

    try {
      const response = await fetch('http://localhost:5000/api/explain', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          classificationReport,
          modelName,
          apiKey,
          prompt
        })
      });

      const data = await response.json();
      setExplanation(data.explanation || 'No explanation available');
    } catch (error) {
      setExplanation('Error: Could not get explanation. Check your API key and connection.');
    }
    setIsLoading(false);
  };

  const saveSettings = () => {
    localStorage.setItem('gemini_api_key', apiKey);
    localStorage.setItem('gemini_prompt', prompt);
    setShowSettings(false);
    alert('Settings saved!');
  };

  return (
    <div className="mt-4">
      <div className="flex gap-2">
        <button
          onClick={handleExplain}
          disabled={isLoading}
          className="flex items-center gap-2 px-4 py-2 bg-space-glow text-black rounded-lg hover:bg-space-glow/80 transition-colors disabled:opacity-50"
        >
          {isLoading ? <Loader className="w-4 h-4 animate-spin" /> : <Sparkles className="w-4 h-4" />}
          {isLoading ? 'Explaining...' : 'Explain with AI'}
        </button>

        <button
          onClick={() => setShowSettings(!showSettings)}
          className="p-2 glass-card hover:bg-white/10 rounded-lg transition-colors"
        >
          <Settings className="w-4 h-4 text-white" />
        </button>
      </div>

      <AnimatePresence>
        {showSettings && (
          <motion.div
            initial={{ opacity: 0, height: 0 }}
            animate={{ opacity: 1, height: 'auto' }}
            exit={{ opacity: 0, height: 0 }}
            className="mt-4 glass-card p-4 rounded-lg"
          >
            <div className="flex justify-between items-center mb-4">
              <h3 className="text-white font-semibold">AI Settings</h3>
              <button onClick={() => setShowSettings(false)}>
                <X className="w-4 h-4 text-white" />
              </button>
            </div>

            <div className="space-y-4">
              <div>
                <label className="block text-white text-sm mb-2">Gemini API Key</label>
                <input
                  type="password"
                  value={apiKey}
                  onChange={(e) => setApiKey(e.target.value)}
                  placeholder="Enter your Gemini API key"
                  className="w-full bg-white/10 text-white px-3 py-2 rounded-lg focus:outline-none focus:ring-2 focus:ring-space-glow"
                />
                <p className="text-xs text-gray-400 mt-1">
                  Get your key from: https://makersuite.google.com/app/apikey
                </p>
              </div>

              <div>
                <label className="block text-white text-sm mb-2">Custom Prompt</label>
                <textarea
                  value={prompt}
                  onChange={(e) => setPrompt(e.target.value)}
                  rows={3}
                  className="w-full bg-white/10 text-white px-3 py-2 rounded-lg focus:outline-none focus:ring-2 focus:ring-space-glow"
                />
              </div>

              <button
                onClick={saveSettings}
                className="w-full bg-space-glow text-black py-2 rounded-lg hover:bg-space-glow/80 transition-colors"
              >
                Save Settings
              </button>
            </div>
          </motion.div>
        )}

        {showExplanation && (
          <motion.div
            initial={{ opacity: 0, y: -10 }}
            animate={{ opacity: 1, y: 0 }}
            className="mt-4 glass-card p-4 rounded-lg"
          >
            <h3 className="text-space-glow font-semibold mb-2 flex items-center gap-2">
              <Sparkles className="w-4 h-4" />
              AI Explanation
            </h3>
            <p className="text-white whitespace-pre-wrap">{explanation}</p>
          </motion.div>
        )}
      </AnimatePresence>
    </div>
  );
};

export default AIExplainer;
